import React from "react";

import Page from '../components/page';

const About = () => {
    return (
        <Page>
            <div className="row">
                <div className="about">
                    <div className="about-head">
                        <h1>About Me</h1>
                    </div>
                    <div className="about-body">
                        <p>My name is Scott Templeton, 4th year Edinburgh Napier University student completing an Honours in User Experience Design.

Focused on producing elegant UX design and experience with Front-end Javascipt technologies such as React and Vue to produce web-based applications. Currently developing an Javascipt animation library to implement micro interactions and responsive animations with an lightweight code base. </p>
                    </div>
                </div>
            </div>
        </Page>

    );
};

export default About;
